import React from 'react'
import stations from '../gares.json'

function CityCards() {
    const cities = stations.keys()

  return <div className='city-cards'>
    {cities.map((city) => (
        <CityCard key={city} city={city} />
    ))}
  </div>
}

export default CityCards
